import React, { Component } from 'react';

class SearchForm extends Component {
    render() {
        return (
            <div className="col-12 formSearch">
                <div className="form-group">
                    <div className="btn-group">
                        <input type="text" className="form-control" placeholder="Nhập từ khoá.." />
                        <button className="btn btn-info"><i className="fa fa-search" /> Tìm</button>
                    </div>
                </div>
                <div className="form-group">
                    <div className="btn-group">
                        <button type="button" className="btn btn-outline-secondary mb-2"  >Đóng lại</button>
                        <button type="button" className="btn btn-outline-info mb-2"  >Thêm mới</button>
                        </div>
                </div>                    
            </div>
        );
    }
}

export default SearchForm;
